import React, { useState } from 'react';
import PokemonList from './PokemonList';
import axios from 'axios';
function App() {
  const [pokemon, setPokemon] = useState(['blubasur', 'charmander'])

  axios.get('https://pokeapi.co/api/v2/pokemon').then(res => {
    res.data
  })
  return (
    <PokemonList 
    pokemon={pokemon} />
  );
}
export default App;
